import React from 'react';
import './Grid.css';
const keys = [
  { top: 'a', bottom: 'b' },
  { top: 'c', bottom: 'd' },
  { top: 'c', bottom: 'd' },
  { top: 'c', bottom: 'd' },
  { top: 'c', bottom: 'd' },
  { top: 'c', bottom: 'd' },
  { top: 'c', bottom: 'd' },
  { top: 'c', bottom: 'd' },
  { top: 'c', bottom: 'd' },
  { top: 'c', bottom: 'd' },
  { top: 'c', bottom: 'd' },
  { top: 'c', bottom: 'd' },
  { type: 'function', value: 'DELETE' },
];
const Grid = ({ onKeyTap }) => {
  //   const renderCells = () => {
  //     let cells = [];
  //     for (let i = 0; i < 16; i++) {
  //       cells.push(<div key={i} className='cell' />);
  //     }
  //     return cells;

  //   };
  const renderCells = () => {
    return keys.map((key, i) => (
      <div
        key={i}
        className={`cell ${key.type || ''}`}
        onClick={() => onKeyTap(key)}
      >
        <div className='top'>{key.top}</div>
        {key.bottom && <div className='bottom'>{key.bottom}</div>}
      </div>
    ));
  };
  return <div className='grid'>{renderCells()}</div>;
};

export default Grid;
